import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import map from './map';
import empty_map from './map2';
import reportWebVitals from './reportWebVitals';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

const mp = ReactDOM.createRoot(document.getElementById('maps'));
mp.render(
    <map />
)

const mp2 = ReactDOM.createRoot(document.getElementById('maps2'));
mp2.render(
  <map2 />
)

// If you want to start measuring performance in your app, pass a function
